import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{ background: '#333', padding: '1rem', marginBottom: '2rem' }}>
      <Link to="/ket-hon" style={{ color: 'white', marginRight: '1rem', textDecoration: 'none' }}>Đăng Ký Kết Hôn</Link>
      <Link to="/ly-hon" style={{ color: 'white', marginRight: '1rem', textDecoration: 'none' }}>Đăng Ký Ly Hôn</Link>
      <Link to="/khai-sinh" style={{ color: 'white', textDecoration: 'none' }}>Đăng Ký Khai Sinh</Link>
    </nav>
  );
}

export default Navbar;
